import React from "react";
import { Link, Route } from "react-router-dom";
import One from "../assets/icons/one.svg";
import Two from "../assets/icons/two.svg";
import Three from "../assets/icons/three.svg";
import Four from "../assets/icons/four.svg";
import Five from "../assets/icons/five.svg";
import Six from "../assets/icons/six.svg";
import Seven from "../assets/icons/seven.svg";
import Eight from "../assets/icons/eight.svg";
import Nine from "../assets/icons/nine.svg";

export default function Types() {
  return (
    <section className="types">
      <div className="types-container">
        <span className="types-container__header">CHOOSE YOUR TYPE</span>
        <Link to={`/types/${type.id}`}>
          <img className="types-container__type" src={One} alt="one" />
        </Link>
        <Link to={`/types/${type.id}`}>
          <img className="types-container__type" src={Two} alt="two" />
        </Link>
        <Link to={`/types/${type.id}`}>
          <img className="types-container__type" src={Three} alt="three" />
        </Link>
        <Link to={`/types/${type.id}`}>
          <img className="types-container__type" src={Four} alt="one" />
        </Link>
        <Link to={`/types/${type.id}`}>
          <img className="types-container__type" src={Five} alt="one" />
        </Link>
        <Link to={`/types/:id`}>
          <img className="types-container__type" src={Six} alt="one" />
        </Link>
        <Link to={`/types/:id`}>
          <img className="types-container__type" src={Seven} alt="one" />
        </Link>
        <Link to={`/types/:id`}>
          <img className="types-container__type" src={Eight} alt="one" />
        </Link>
        <Link to={`/types/:id`}>
          <img className="types-container__type" src={Nine} alt="one" />
        </Link>
      </div>
    </section>
  );
}
